INSERT INTO `cc1_content` VALUES (17,73,'Photo Souvenirs','photo-souvenirs','','<h2>Photo Souvenirs</h2>\r\n<p>We also offer \"Photo Souvenirs\" at any private event (for an additional fee). A photographer will come to your event and take a picture of each of your guests with their favorite animal. The picture will be printed at the event and put into 4x6 photo folders for giving out as party favors. If you would like to add Photo Souvenirs to your event, just select it when you fill out the contract!</p>\r\n<p><img src=\"images/photo%20souvenir%20example4.jpg\" border=\"0\" alt=\"Photo souvenirs can be made at any event\" width=\"311\" height=\"396\" /></p>','',1,0,0,9,'2013-01-01 01:56:54',42,'','2013-01-01 02:09:36',42,0,'0000-00-00 00:00:00','2013-01-01 01:56:54','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,2,'','',1,53,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (18,74,'Hiring for Spring','hiring-for-spring','','<h2><a href=\"index.php?option=com_content&amp;view=article&amp;catid=14&amp;id=13\">Now Hiring</a></h2>\r\n<p>Cathy\'s Critters is getting ready to staff up for the busy Spring season! We are a seasonal business and the spring festival season starts in March, so we hire petting zoo attendants for the 2-month period of March-April. We also think of it as a \"trial period\" for potential permanent employees, so please contact us if you are at least 16 years of age (or close), have reliable transportation to the farm, and would love an opportunity to help us spread the joy of animal communion.</p>\r\n<p><a href=\"images/employees/dscn6956.jpg\"><img class=\"caption\" src=\"images/employees/dscn6956.jpg\" border=\"0\" alt=\"November babies born\" title=\"Shadow\'s baby\" width=\"206\" height=\"154\" /></a></p>','',1,0,0,14,'2012-11-21 01:52:58',42,'','2013-01-01 02:42:26',42,0,'0000-00-00 00:00:00','2012-11-21 01:52:58','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,0,'','',1,8,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (19,78,'Sub-Logo','sub-logo','','<p>Cathy\'s Critters</p>\r\n<p>Give critters a chance (TM)</p>','',1,0,0,2,'2013-01-20 21:16:07',42,'','2013-01-20 21:17:08',42,0,'0000-00-00 00:00:00','2013-01-20 21:16:07','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,1,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
INSERT INTO `cc1_content` VALUES (20,79,'Why choose our petting zoo','selling-points','','<h1>Heading 1</h1>\r\n<h2>Heading 2</h2>\r\n<h3>Heading 3</h3>\r\n<h4>Heading 4</h4>\r\n<p></p>\r\n<p>A petting zoo is always one of the best-attended and best-loved attractions at any event. Kids and parents alike get to spend time petting, cuddling, and feeding animals they don\'t get to see every day. We bring the critters, portable fences, cups, feed, sanitizer, and knowledgeable attendants to make your event memorable.</p>\r\n<p>Our animals are always clean and well-behaved. They get lots of attention and handling and so are naturally tame and gentle. Our attendants are the same. We hire people with a passion for teaching kids about animals through gentle coaching and encouragement.</p>\r\n<p>We are an on-time machine, spending as much time on office organization and planning as we spend in the petting zoos themselves. We have an office manager dedicated to making sure your team arrives on time and prepared to make your party memorable for all your guests. Our farm hand employees make sure the equipment is well-maintained and the trailers are properly stocked for your events. At Cathy\'s Critters, we don\'t believe in cutting corners, and it shows in our presentation. We can set up on grass or concrete, and our fence panels are portable and quick to set up, ensuring that we are ready on time and packed up, cleaned up and out of your way quickly after the event.</p>','',0,0,0,9,'2013-01-20 22:07:28',42,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,1,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
