INSERT INTO `cc1_content` VALUES (22,111,'Field Trips','field-trips','','<h2>Class Field Trips</h2>\r\n<p>Our premium field trip for large school groups with plenty of bus parking, restrooms, and an all-weather venue is the visit we host at Myers Park And Event Center. A different on-farm experience is available for small- to medium-sized groups at Cathy\'s Critters headquarters in Princeton, Texas.</p>\r\n<p></p>\r\n<h4 style=\"text-align: right;\">Myers Park &amp; Event Center</h4>\r\n<p><img src=\"http://www.co.collin.tx.us/parks/photos/myers_logo_med.gif\" border=\"0\" alt=\"Myers Park logo\" width=\"147\" height=\"239\" style=\"margin-left: 10px; margin-right: 10px; float: right;\" /></p>\r\n<ul>\r\n<li>\r\n<p>State-of-the-art covered facility</p>\r\n</li>\r\n<li>\r\n<p>School bus parking</p>\r\n</li>\r\n<li>\r\n<p>Large field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Dog safety and agility demonstration</p>\r\n</li>\r\n<li>\r\n<p>Live farm animals</p>\r\n</li>\r\n<li>\r\n<p>Traditional farm skills: spinning, milking</p>\r\n</li>\r\n<li>\r\n<p>$8/child, $6/parent, $2/teacher</p>\r\n</li>\r\n</ul>\r\n<p></p>\r\n<p></p>\r\n<h4 style=\"text-align: left;\">Visit Cathy\'s Critters\' Farm</h4>\r\n<p><img src=\"images/kidsandanimals/girl_and_pig_256_cropped.jpg\" border=\"0\" alt=\"Farm visitor and &quot;Pumpkin&quot; the pig\" width=\"332\" height=\"332\" style=\"float: left; margin-left: 20px; margin-right: 20px;\" /></p>\r\n<h4 style=\"text-align: left;\"></h4>\r\n<ul>\r\n<li>\r\n<p>18-acre working farm</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>Weather-permitting</p>\r\n</li>\r\n<li>\r\n<p>Small-group field trips</p>\r\n</li>\r\n<li>\r\n<p>Documentation of TEKS covered</p>\r\n</li>\r\n<li>\r\n<p>Goat-milking</p>\r\n</li>\r\n<li>\r\n<p>Exotic animal demos</p>\r\n</li>\r\n<li>\r\n<p>Hands-on petting zoos</p>\r\n</li>\r\n<li>\r\n<p>Picnic area</p>\r\n</li>\r\n<li>\r\n<p>Call Lisa at 972-562-0583 for pricing and activity selection</p>\r\n</li>\r\n</ul>','',1,0,0,9,'2012-11-09 01:43:44',42,'','2013-02-17 18:42:13',42,42,'2013-02-17 18:42:13','2012-11-09 01:43:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',7,0,0,'','',1,13,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');
