INSERT INTO `cc1_joomblog_posts` VALUES (6,69,'Welcome to Cathy\'s Critters','welcome-to-cathys-critters','<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Hi, friends!<br /></span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\"><img src=\"images/kidsandanimals/dsc09191.jpg\" border=\"0\" alt=\"Cathy presenting WorldWide Safari\" width=\"196\" height=\"140\" style=\"border: 6px solid white; float: left;\" /></span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Welcome to the Cathy\'s Critters blog! We\'ve been a little behind the curve on social media, although we have had lots to say and share since beginning our business almost 8 years ago. We started our business with a static 5-page web site listing prices and packages and a few pictures.</span></p>\r\n<p><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">While we haven\'t crowed about it online much, Cathys Critters has been a community name in the DFW area for almost 8 years. Weve brought our animals to hundreds of birthday parties, festivals, summer camps, church, and civic events and weve been lucky enough to be the cause of countless smiles as kids learn gentleness, patience, and humor while holding rabbits, riding ponies, or having their hair nibbled by miniature goats. </span></p>\r\n<p><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Since our founding, weve also started Critter Camp, a week-long summer camp where kids learn to milk goats, ride horses, and do crafts and biology experiments. On the last night, the kids get to camp beneath the stars and see the constellations that are usually obscured by the light pollution in the cities and suburbs where they live. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">When we started Cathys Critters, the purpose of the company was to pay for Cathys many pets. When she and her family moved out to 18 acres in the country, she began raising all the animals she never could while living in suburbia -- goats, birds, horses, chickens, pigs. But those animals quickly became very expensive. Between vet bills, hay, housing, and feed, it was time for the animals to earn their keep! </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">But as the company grew, Cathys mission evolved. She found a real purpose in teaching children about animals, and she developed a strong belief in the power of human-animal interaction. She observed shy children who would open up when they spent time around the animals. She watched autistic children who had a hard time relating to humans discover a connection with an animal. She watched babies as they learned to control their motor skills while petting a rabbit. She watched children with ADD find focus and concentration when bottle-feeding a baby goat. She witnessed these types of interactions over and over and it became apparent to her that animal interaction is an important part of any childs development. It encourages empathy and understanding and can help children become responsible, well-rounded, and loving adults. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">As this belief gets embedded more and more deeply into the mission and vision of Cathys Critters, our goal is to reach as many people as we can with our message. Thats why were starting this online campaign. To educate and inform. To share our passion. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">And we couldnt do that without you, our audience. So thank you, sincerely, for reading. For more news and updates, subscribe to this blog, like us on Facebook, and follow us on Twitter.</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">Until next time,</span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">The Cathys Critters Team </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;\">P.S. Happy Holidays! </span></p>','',1,17,'2012-12-18 06:00:00',42,'2012-12-20 20:51:27',42,'2012-12-20 06:00:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"read more...\"}',11,0,2,'','',1,156,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (7,76,'Do Chinchillas Take Baths?','do-chinchillas-take-baths','<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><img src=\"images/chinchillas_at_work.jpeg\" border=\"0\" alt=\"Chinchillas &amp; TPS Reports\" title=\"Chinchillas in the Office! \" width=\"295\" height=\"222\" style=\"float: left; margin-left: 10px; margin-right: 10px; border: 2px solid black;\" />Here at Cathys Critters, there are animals everywhere you turn -- even in the office! Along with a couple of cockatiels, a ball python, and a bearded dragon, we have handful of chinchillas that keep Lisa and I company while we take calls from customers and schedule events.</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">If you havent seen the chinchillas at a<span class=\"Apple-converted-space\"></span></span><a href=\"http://petsupervisor.com/index.php/services/indoor-presentations\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">World Wide Safari</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><span class=\"Apple-converted-space\"></span>presentation, they are a small rodent native to the Andes Mountains in South America. Theyre known for their extremely soft fur. In fact, they have the second densest fur of any mammal (the first is the sea otter!).<span class=\"Apple-converted-space\"></span></span></p>\r\n','\r\n<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Chinchillas make great first pets because they are quiet, well-mannered, and relatively clean. They also become very personable when handled often, and are even hypoallergenic! They do require some special care, including being kept at a temperature below 80 degrees (they cant release heat with sweat like humans do, so could suffer a heat stroke if they get too warm). They also need a multi-level cage with a home that they can hide in to replicate the climbing and burrowing they would do in the wild. Just be sure to do your research before adopting one into your family!<span class=\"Apple-converted-space\"></span></span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">One interesting fact about chinchillas is that they never need a bath! Well, ok... thats not entirely true. They just dont need baths like you and I do, with water, shampoo, soap and a loofah. In fact, this sort of bath would be harmful to their fur. Chinchillas have an average of 60 hairs per follicle (while humans only have 1) and because of the density of their fur, they cant air dry like a dog or a cat can after a bath. The moisture in the fur of a wet chinchilla can trigger the growth of fungus or bacteria. So how do they stay clean?<span class=\"Apple-converted-space\"></span></span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">In the wild, chinchillas roll around in volcanic rock that has been naturally ground down to fine powder. The dry dust pulls out the oils and dirt from the Chinchillas fur, leaving them clean and soft. Domesticated chinchillas still have to keep clean, but its hard to find actual volcanic rock from the Andes for them to bathe in! Instead, you can find a packaged dust made out of pumice at most pet stores.<span class=\"Apple-converted-space\"></span></span></p>\r\n<p><span>Our chinchillas obviously arent shy about bathing in public! Take a look a video of one of our little rodents showing off in front of a big group of kids at a presentation this past December.</span></p>\r\n<p><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"><iframe style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://www.youtube.com/embed/a_OUKeXE-VU\" frameborder=\"0\" width=\"569\" height=\"320\"></iframe></span></p>\r\n<p><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Have questions about raising a chinchilla or want to share pictures of your own pet? Leave us a comment in the section below -- we love hearing from you! And to keep in touch with Cathys Critters, dont forget to<span class=\"Apple-converted-space\"></span></span><a href=\"https://www.facebook.com/cathys.critters1\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">like us on Facebook</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\"> and </span><a href=\"https://twitter.com/CathyCritterZoo\" style=\"margin: 0px; padding: 0px; font-family: Tahoma,Arial,Helvetica,sans-serif; color: #8f8649; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\">follow us on Twitter</a><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">!</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Hugs &amp; Critters,</span><br style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff;\" /><span style=\"color: #413d21; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;\">Cathy</span></p>',1,17,'2013-01-08 01:53:34',50,'2013-02-17 05:09:17',42,'2013-01-08 01:53:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',8,0,0,'','',1,130,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (8,77,'Whatcha\' Eatin\'?','herbivores-carnivores-omnivores','<p><img src=\"images/animals/ChickenAndCat.jpg\" border=\"0\" alt=\"Cat checking out the chicken\" title=\"Whatcha\' Eatin\'?\" width=\"121\" height=\"163\" style=\"float: left; margin-right: 4px;\" /></p>\r\n<p></p>\r\n<p>Life surrounds us here on the farm. I love watching all the goats, llamas and cows grazing in the pastures while the dogs chase a squirrel up a tree. People often ask how all these animals live together and wonder if it\'s really all peace and harmony?The short answer is now, but the question brings up an interesting aspect of the animal kingdom -- how we classify all these different species. There are several ways to group animals, but one of the easiest is by their diet. The three most common dietary classifications are carnivore, omnivore, and herbivore. Lets take a look at each classification and see which animals on the farm belong to which category.</p>\r\n<h3></h3>\r\n<h4>Herbivores</h4>\r\n<h3><img src=\"images/animals/Llama.JPG\" border=\"0\" alt=\"Llama\" title=\"What are you looking at?\" width=\"259\" height=\"172\" style=\"float: right; margin-right: 4px;\" /></h3>\r\n<p>The herbivore is probably the largest group of animals here on the farm. The word herbivore can be broken down into two parts: <span style=\"text-decoration: underline;\">herba,</span> meaning a small plant or herb; and <span style=\"text-decoration: underline;\">vora</span>,meaning to eat or devour. These animals eat plants almost exclusively. Their anatomy and digestive systems make it possible to digest the hard outer cellular wall of plant matter. Key features of herbivores are flat-surfaced back teeth for grinding and a very long intestinal tract. Herbivores are known as primary consumers. Many farm animals, including cows, goats, horses and llamas, are herbivores. Also, most rodents are also classified as herbivores.</p>\r\n<h3></h3>\r\n<h3><img src=\"images/animals/Izzie.JPG\" border=\"0\" alt=\"Cute?  Don\'t let her fool you...\" title=\"Izzie\" width=\"235\" height=\"156\" style=\"float: left;\" /></h3>\r\n<h4 style=\"text-align: right;\"></h4>\r\n<h4 style=\"text-align: right;\">Carnivores</h4>\r\n<p>Farmers are often trying to protect their herd against animals that only eat meat -- coyotes, wild cats, and wolves, for example. These animals are carnivores. True carnivores depend on the nutrients found only in animal flesh. They may consume small amounts of plant material but they cannot physically digest vegetable matter. The carnivore also has several physical characteristics that reveal their dietary needs. The most obvious are their large fangs known as canine teeth. These teeth are used to hold onto and tear up food. Most carnivores also have eyes that face forward rather than out to the side like many herbivores. The forward-facing eyes gives them better depth perception, and an advantage in hunting and killing their food. In the food chain, the carnivore is on top and is known as a predator. So would a farm have many carnivores living amongst the herbivores? Probably not. However the best known carnivore is considered mans best friend -- your dog! Dogs and cats are both carnivores. Next time your dog or cat opens its mouth, take a look at those large canine teeth. We do have a few other exotic carnivores on the farm, like ferrets, and we must be very careful not to let them around any of our smaller herbivorous friends.</p>\r\n<h3></h3>\r\n<h4>Omnivores</h4>\r\n<p>The last category of animals, grouped by diet, is the omnivore. If we break this word down into its latin orgins we see that <span style=\"text-decoration: underline;\">omni</span><img src=\"https://sphotos-a.xx.fbcdn.net/hphotos-ash3/578009_399238266823223_1784704241_n.jpg\" border=\"0\" alt=\"sugarglider baby\" title=\"Sugargilder \" width=\"161\" height=\"240\" style=\"float: right;\" />means \"all\" or \"everything\", and <span style=\"text-decoration: underline;\">vorae</span> means to devour. These animals can eat both animal and plant matter. The omnivore <br class=\"Apple-interchange-newline\" /><br />usually has characteristics similar to the carnivore in that it has canine teeth but also has crushing teeth like herbivores. We have <br />several different types of omnivores on the farm. These include pigs, chickens and the farmers... humans are omnivores, too! We also have coatimundis, hedgehogs and sugargliders that fit into this category.</p>\r\n<p>Next time you see an animal in your neighborhood, at the park, or even a pet store, try to think like a zoologist and figure out what classification the critter fits into by looking a little bit closer at it. Finding out how animals in our environment work together and depend on each other gives us a deeper understanding of the animal kindgom, and our world!</p>\r\n<p></p>\r\n<p>Hugs and Critters,</p>\r\n<p>Cathy<br /><br /></p>\r\n<p></p>\r\n<p></p>','',1,17,'2013-01-17 03:18:41',50,'2013-01-20 20:35:37',87,'2013-01-17 03:18:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',27,0,0,'','',1,66,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
INSERT INTO `cc1_joomblog_posts` VALUES (9,110,'Raising active kids means raising healthy kids. ','raising-active-kids-means-raising-healthy-kids','<p><strong id=\"internal-source-marker_0.36245005298405886\" style=\"color: #000000; font-family: \'Times New Roman\'; font-size: medium; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; font-weight: normal;\"><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">I moved with my family of five to the farm that is Cathys Critters nearly 10 years ago. While wed always been a pretty active, outdoorsy family with lots of animals running around, the kids had to transition from a life in suburbia to one on a working hobby farm. Their chore list grew from cleaning their rooms and helping with the dishes to feeding horses and cleaning out rabbit cages. </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Despite getting pretty dirty, my three kids have turned into healthy young adults now. There are many factors that contribute to their good health (genetics, of course -- I have good ones!), but Ive always thought that one of the reasons they seem to rarely get sick during flu season and dont have allergies was because they were exposed to allergens and germs at an early age, and their bodies learned how to fight off the bad guys.</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Come to find out, theres some truth behind that notion. A recent study found that children who grow up on farms see  the incidence of asthma and  the incidence of hay fever allergies than children who dont. Heres the report: </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">\"Children Raised On Farms Develop Better Immune Systems\"</span><br /><a href=\"http://www.youtube.com/watch?v=vQ14PEz8stg\" target=\"_blank\" title=\"Children Raised on Farms\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">http://youtu.be/Ek6QIdYi4wc</span></a><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">And if youre interested in learning more about how germs interact with our bodies, check out this book by Rob Dunn, </span><a href=\"http://www.amazon.com/Wild-Life-Our-Bodies-Predators/dp/006180648X\" target=\"_blank\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">The Wildlife in Our Bodies</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">.</span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">While we cant all raise our children on a farm, there are still ways to strengthen their immune system with good old-fashioned dirt and grime. Here are a few tips to keep your kids healthy -- with outdoor activity, exercise, and animal interaction: </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Take a hike! </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Make the kids put down Fruit Ninja and Angry Birds, tie up your walking shoes, and make it out to one of DFWs many nature trails. Bring a nature diary where your kids can draw pictures and write descriptions of the types of animal tracks, insects, and other wildlife they come across. Start your exploration at the </span><a href=\"http://www.fwnaturecenter.org/index.php?option=com_content&amp;view=article&amp;id=49&amp;Itemid=54\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Fort Worth Nature Center and Refuge</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, </span><a href=\"http://dfw.cbslocal.com/top-lists/best-hiking-trails-near-dallas/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Dinosaur Valley State Park</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> in Glen Rose, or </span><a href=\"http://www.texasoutside.com/hikebike/BreckinridgeFrames.htm\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Breckenridge Park</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> in Richardson. </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Adopt a dog or a cat</span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> - Growing up with animals has a lot of benefits, not least of which is a defense against pet allergies. When you introduce animals to your home while your child is young, theyre less likely to develop fur and dander-related respiratory issues as they grow up. Visit the </span><a href=\"http://dognkittycity.org/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Humane Society</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> and bring home a four-legged, furry family member. Its good for your health </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: italic; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">and</span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\"> your happiness :) </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Summer camp - </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Instead of playing video games and watching TV over the summer, sign your kids up for an outdoor, interactive summer program. There are a few in the DFW, including our own </span><a href=\"http://petsupervisor.com/index.php/services/critter-camp\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Critter Camp</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">. Also check out the </span><a href=\"http://www.dallaszoo.com/education/camps-classes/summer-camp/\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Dallas Zoos day camp</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, the </span><a href=\"http://www.brit.org/webfm_send/128\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Botanical Research Institute of Texas programs</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">, </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">and the </span><a href=\"http://www.riverlegacy.org/component/content/article/168.html\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">River Legacys summer nature adventures.</span></a><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Gardening </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">- Let the kids get their hands in the dirt by starting a garden in the backyard. Even if you dont have a green thumb, there are plenty of ways to get started with gardening as a beginner and even more ways to get your kids involved. Start with an herb garden on your porch, or a raised bed. </span><a href=\"http://www.huffingtonpost.com/2012/05/29/edible-garden-tips-gardening_n_1553106.html\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Here are a couple of tips for breaking ground</span></a><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">! </span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Raise backyard chickens. </span><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Have your kids collect eggs and clean out the coop. Even if theres not a direct correlation between mucking out stalls and the health of your kids, theyll still learn responsibility and maturity as they raise the chickens, and your whole family will be able to enjoy farm-fresh eggs from healthy, happy chickens. There are plenty of ways to get started with raising chickens in your backyard. This website is a great resource: </span><a href=\"http://www.backyardchickens.com/a/how-to-raise-backyard-chickens-in-your-city-the-basics-of-raising-chickens\"><span style=\"font-size: 15px; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">Raising chickens!</span></a><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">How else do you keep your kids healthy and active? Leave us a comment below and let us know! </span><br /><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Hugs and Critters,</span><br /><span style=\"font-size: 15px; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: initial; vertical-align: baseline; white-space: pre-wrap;\">Cathy </span></strong></p>','',-2,17,'2013-02-15 06:00:00',87,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','{\"alternative_readmore\":\"\"}',1,0,0,'','',1,0,'{\"metakey\":\"\",\"metadesc\":\"\",\"page_image\":\"\",\"ogdesc\":\"\"}','*',0);
